import "./App.css";
import {Routes, Route, BrowserRouter} from "react-router-dom"

const App = () => {
  
  return (
    <>
   <BrowserRouter>
    <Routes>
      <Route path="/" element={<h1>Home Todo's Page</h1>}/>
      <Route path="/" element={<h1>Login Page</h1>}/>
      <Route path="/" element={<h1>Signup Page</h1>}/>
      <Route path="/" element={<h1>Logout Page</h1>}/>
    </Routes>
   </BrowserRouter>
    </>
  );
};

export default App;
